INSERT INTO `project` VALUES (1,'1','2019-03-09 11:28:56','2019-03-21','1','1','java','1',0),(2,'crowdsourcing','2019-03-09 13:38:02','2019-03-15','众包需求管理与分析系统','软件需求','Java','由于成本，工期，人力等问题的限制，软件开发者往往难以与目标受众直接沟通交流，从而获得他们对软件产品的需求，这成为了需求工程中的一大难题。同时，软件需求的管理与分析一直是软件开发的重要环节，影响着软件产物的最终质量，有着重大意义。众包软件需求管理与分析系统的主要目标为给开发团队和软件目标受众提供一个交流的平台，并为开发者的软件需求分析和软件设计提供便利。',0),(3,'wx','2019-03-10 10:38:06','2019-03-30','Bootstrap 分页本章将讲解 Bootstrap 支持的分页特性。分页(Pagination),是一种无序列表,Bootstrap 像处理其他界面元素一样处理分页。','计算机','java','功能需求：\r\n今天在写一个站点需要用到在导航菜单点击链接跳转到新页面后，高亮当前菜单样式。\r\n简单的说，就是我点击导航菜单中的一个栏目，跳转到该栏目下，该栏目菜单也同时高亮（可以是背景色也可以是背景图片）\r\n\r\n解决方法：\r\n通过查看实例，我们需要用到JS中的jquery来实现这种效果，也可以通过CSS设置不同页面的a:hover实现效果，不过这显然是比较笨拙的方法。\r\n那么，如何用JS来实现效果呢,实现它所用的原理就是通过js中的location.href得到当前页面的地址，然后在与导航上的链接地址匹对，相同的就用一个css样式标记。此方法支持动态链接和静态链接多种形式。\r\n效果图：\r\n--------------------- \r\n作者：yusirxiaer \r\n来源：CSDN \r\n原文：https://blog.csdn.net/yusirxiaer/article/details/62216550 \r\n版权声明：本文为博主原创文章，转载请附上博文链接！',0),(4,'wx','2019-03-10 15:06:28','2019-03-13','我的项目','计算机','java/tml','乡愁是一份沉重的爱。离开故土的游子，默默将爱收藏在心底。在异乡打拼，心里异常孤独，对着城市的钢筋水泥，对着那些永远都不可能与之说心里话的人，心中充满惆怅。在寂寞的时候，对着荷塘月色，想起故乡的袅袅炊烟，想起脸上堆满皱纹的阿爸阿妈，想起故乡的那条清澈的小河，想起儿时的玩伴，心中不由泛起甜蜜而酸涩的涟漪。\r\n\r\n　　乡愁是一份深沉的爱。想起余光中的一首诗：小时候//乡愁是一枚小小的邮票//我在这头//母亲在那头//长大后//乡愁是一张窄窄的船票 我在这头//新娘在那头//后来啊//乡愁是一方矮矮的坟墓//我在外头//母亲啊在里头//而现在//乡愁是一湾浅浅的海峡//我在这头//大陆在那头。乡愁，承载着游子多少牵挂，多少痴缠的情感，多少浓烈的爱意，多少望穿秋水的期盼。\r\n\r\n　　对母亲的牵挂，是乡愁中最浓烈的爱。想起母亲年轻时那乌黑的长发，发中飘散着游子熟悉的发香。小时候，游子时常依偎在母亲的怀中，听母亲讲河神的故事。对游子来说，母亲就是那条小河，有着清澈的眼睛，有着丰盈的乳汁，有着对自己细水长流爱。母爱如水，他如河旁的小草。从小到大，那条母亲河源源不断地滋润着他，陪伴他成长。',0),(5,'1','2019-03-09 11:28:56','0001-01-01','1','1','5','乡愁是一份沉重的爱。离开故土的游子，默默将爱收藏在心底。在异乡打拼，心里异常孤独，对着城市的钢筋水泥，对着那些永远都不可能与之说心里话的人，心中充满惆怅。在寂寞的时候，对着荷塘月色，想起故乡的袅袅炊烟，想起脸上堆满皱纹的阿爸阿妈，想起故乡的那条清澈的小河，想起儿时的玩伴，心中不由泛起甜蜜而酸涩的涟漪。\n\n　　乡愁是一份深沉的爱。想起余光中的一首诗：小时候//乡愁是一枚小小的邮票//我在这头//母亲在那头//长大后//乡愁是一张窄窄的船票 我在这头//新娘在那头//后来啊//乡愁是一方矮矮的坟墓//我在外头//母亲啊在里头//而现在//乡愁是一湾浅浅的海峡//我在这头//大陆在那头。乡愁，承载着游子多少牵挂，多少痴缠的情感，多少浓烈的爱意，多少望穿秋水的期盼。\n\n　　对母亲的牵挂，是乡愁中最浓烈的爱。想起母亲年轻时那乌黑的长发，发中飘散着游子熟悉的发香。小时候，游子时常依偎在母亲的怀中，听